import EditableTable from './poll/index'
import { Button } from 'antd';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <EditableTable/>
        <Button type="primary">Primary Button</Button>
      </header>
    </div>
  );
}

export default App;
